import React, {Component} from 'react';
import {FaCocktail, FaHiking , FaShuttleVan,FaBeer} from "react-icons/all";
import Title from "./Title";

class Services extends Component {
    render() {
        return (
            <div>
                <Title title='services'/>
            </div>
        );
    }
}

export default Services;
